import { Link, Navigate } from "react-router-dom";

function Header() {
  const onClick = () => {
Navigate("/about");
  }
  return (
    <header>
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <button onClick={onClick}>About</button>>
        </li>
      </ul>
    </header>
  );
}

export default Header;
